	public function hasOnlyDefaultValues()
	{
			// First, ensure that we don't have any columns that have been modified which aren't default columns.
			if (array_diff($this->modifiedColumns, array(SchemaPeer::AGENT_ID,SchemaPeer::NAME,SchemaPeer::URI,SchemaPeer::BASE_DOMAIN,SchemaPeer::TOKEN,SchemaPeer::LAST_URI_ID,SchemaPeer::STATUS_ID,SchemaPeer::LANGUAGE,SchemaPeer::NS_TYPE))) {
				return false;
			}

			if ($this->agent_id !== 0) {
				return false;
			}

			if ($this->name !== '') {
				return false;
			}

			if ($this->uri !== '') {
				return false;
			}

			if ($this->base_domain !== '') {
				return false;
			}

			if ($this->token !== '') {
				return false;
			}

			if ($this->last_uri_id !== 100000) {
				return false;
			}

			if ($this->status_id !== 1) {
				return false;
			}

			if ($this->language !== 'en') {
				return false;
			}

			if ($this->ns_type !== 'slash') {
				return false;
			}

		// otherwise, everything was equal, so return TRUE
		return true;
	} // hasOnlyDefaultValues()

