	 * @return     void
	 * @throws     PropelException - if this object is deleted, unsaved or doesn't have pk match in db
	 */
	public function reload($deep = false, PropelPDO $con = null)
	{
		if ($this->isDeleted()) {
			throw new PropelException("Cannot reload a deleted object.");
		}

		if ($this->isNew()) {
			throw new PropelException("Cannot reload an unsaved object.");
		}

		if ($con === null) {
			$con = Propel::getConnection(SchemaPeer::DATABASE_NAME, Propel::CONNECTION_READ);
		}

		// We don't need to alter the object instance pool; we're just modifying this instance
		// already in the pool.

		$stmt = SchemaPeer::doSelectStmt($this->buildPkeyCriteria(), $con);
		$row = $stmt->fetch(PDO::FETCH_NUM);
		$stmt->closeCursor();
		if (!$row) {
			throw new PropelException('Cannot find matching row in the database to reload object values.');
		}
		$this->hydrate($row, 0, true); // rehydrate

		if ($deep) {  // also de-associate any related objects?

			$this->aAgent = null;
			$this->aUserRelatedByCreatedUserId = null;
			$this->aUserRelatedByUpdatedUserId = null;
			$this->aStatus = null;
			$this->aProfile = null;
			$this->collProfilePropertys = null;
			$this->lastProfilePropertyCriteria = null;

			$this->collNamespaces = null;
			$this->lastNamespaceCriteria = null;

			$this->collSchemaPropertys = null;
			$this->lastSchemaPropertyCriteria = null;

			$this->collSchemaPropertyElementHistorys = null;
			$this->lastSchemaPropertyElementHistoryCriteria = null;

			$this->collSchemaHasUsers = null;
			$this->lastSchemaHasUserCriteria = null;

